import React from 'react';
import { Image, Icon } from 'semantic-ui-react';
import PropTypes from 'prop-types';

const ContactAvatar = ({ ccontact, size }) => {
	const imageIcon =
		ccontact && ccontact.contactImageUrl ? (
			<Image avatar src={ccontact.contactImageUrl} size={size} rounded />
		) : (
			<Icon color="blue" name="user circle" size={size} />
		);
	const userImage = ccontact ? <>{imageIcon}</> : <div></div>;
	return userImage;
};
ContactAvatar.defaultProps = {
	profile: {
		profileImage: {
			image: {
				data: null,
			},
		},
	},
	size: 'medium',
};
ContactAvatar.propTypes = {
	profile: PropTypes.object,
	size: PropTypes.string,
};
export default ContactAvatar;
